import React from 'react'

function Order({data}) {

  return (
    <div>
        <span>Order number : {data.id}</span><br></br>
        <span>Total : ${data.total}</span><br></br>
        <span>Order passed on : {data.created_at}</span>
    </div>
  )
}

export default Order
